//============================================================================//
void Parameter::initialize(int argc,char *argv[])
//============================================================================//
{
    default_param();

    for( int i = 0 ; i < 3 ; i++ ) { //Receptor PDB, Ligand PDB, Outfile
        _IO_flag[i] = 0;
    }

    optind = 1;
    int ch;

    std::string pdb_ext_r_b("_r_b.pdb"); // for input support
    std::string pdb_ext_l_b("_l_b.pdb");
    std::string pdb_ext_r_u("_r_u.pdb");
    std::string pdb_ext_l_u("_l_u.pdb");
    std::string detail_ext(".detail");
    std::string csv_ext(".csv");

    while( (ch = getopt(argc, argv,
                        /*
                            Line 1:input files
                            Line 2:output
                            Line 3:parameters
                            Line 4:calculation options
                        */
                        "\
    R:L:B:U:\
    o:ON:t:E:\
    a:b:e:d:F:v:\
    Dhy:z:r:f:i:jkl:S:G:T:"
                        )) != -1 ) {
        switch( ch ) {
            //-----------------------------------------------------------------
            // input PDB file -------------------------------------------------

        case 'R':
            _RecPDB_file  = optarg;
            _IO_flag[0]   = 1;
            break;
        case 'L':
            _LigPDB_file  = optarg;
            _IO_flag[1]   = 1;
            break;
        case 'B': // for input support
            _RecPDB_file  = optarg+pdb_ext_r_b;
            _IO_flag[0]   = 1;
            _LigPDB_file  = optarg+pdb_ext_l_b;
            _IO_flag[1]   = 1;
            break;
        case 'U': // for input support
            _RecPDB_file  = optarg+pdb_ext_r_u;
            _IO_flag[0]   = 1;
            _LigPDB_file  = optarg+pdb_ext_l_u;
            _IO_flag[1]   = 1;
            break;

            //-----------------------------------------------------------------
            // output options -------------------------------------------------

        case 'o':
            _RLOut_file = optarg;
            _RLOut_file_detail = optarg+detail_ext;
            _RLOut_file_csv = optarg+csv_ext;
            if(_RLOut_file.length() > 4) {
                if(_RLOut_file.substr(_RLOut_file.length()-4)==".out") {
                    _RLOut_file_detail = _RLOut_file.substr(0,_RLOut_file.length()-4)+detail_ext;;
                    _RLOut_file_csv = _RLOut_file.substr(0,_RLOut_file.length()-4)+csv_ext;;
                }
            }
            _IO_flag[2]   = 1;
            break;
        case 'O':
            detail_output_flag = 1;
            break;
        case 'N':
            _Num_output   = atoi(optarg);
            _Num_output_flag  = 1;
            cout << "# Number of output = " << _Num_output << endl;
            break;
        case 't':
            _Num_sort = atoi(optarg);
            cout << "# Set number of scores per one angle = " << _Num_sort << endl;
            break;
        case 'E':
            calc_time_log_output_flag = atoi(optarg);
            break;
        case 'i':
            calc_id = optarg;
            break;

            //-----------------------------------------------------------------
            // setting parameters ---------------------------------------------

        case 'e':
            _Elec_ratio   = atof(optarg);
            if (f1_flag == 1) {
                printf("Do not use -f 1 and -e option at the same time.\n");
                exit(1);
            }
            f1_flag = -1; // do not use rPSC only
            cout << "# Set electric term ratio = "<< _Elec_ratio << endl;
            break;
        case 'd':
            _ACE_ratio = atof(optarg);
            if (f1_flag == 1 || f2_flag == 1) {
                printf("Do not use -f 1 or 2 and -d option at the same time.\n");
                exit(1);
            }
            f1_flag = -1; // do not use rPSC only
            f2_flag = -1; // do not use rPSC and Elec function
            cout << "# Set ACE term ratio = " << _ACE_ratio << endl;
            break;
        case 'a':
            _rPSC_param_rec_core = atof(optarg); // Receptor core
            break;
        case 'b':
            _rPSC_param_lig_core = atof(optarg); // Ligand core
            break;
        case 'F':
            _Num_fft  = atoi(optarg);
            _Num_grid = _Num_fft / 2;
            _Num_fft_flag = 1;
            cout << "# Number of FFT N  = " << _Num_fft << endl;
            break;
        case 'v':
            grid_width    = atof(optarg);
            cout << "# Set voxel size   = " << grid_width << endl;
            break;

            //-----------------------------------------------------------------
            // setting calculation mode ---------------------------------------
        case 'T':
            _Num_thread_limit = atoi(optarg);
            if(_Num_thread_limit<1) {
                printf("Please set a positive number (Number of cores).\n");
                exit(1);
            }
            omp_set_num_threads(_Num_thread_limit);
            break;
        case 'G':
            _Num_GPU_limit = atoi(optarg);
            if(_Num_GPU_limit<0) {
                printf("Please set a non-negative number (Number of GPUs you want to use).\n");
                exit(1);
            }
            break;
        case 'f':
            _Score_func   = atoi(optarg);
            cout << "#Set score Function = "   << _Score_func << endl;
            assert( 1 <= _Score_func && _Score_func <= 3 );
            if(_Score_func == 1) {
                _Elec_ratio   = 0.0;
                _ACE_ratio    = 0.0;
                if (f1_flag == -1) {
                    printf("Do not use -f 1 and -e/-d option at the same time.\n");
                    exit(1);
                }
                f1_flag       = 1;
            } else if(_Score_func == 2) {
                _ACE_ratio    = 0.0;
                if (f2_flag == -1) {
                    printf("Do not use -f 2 and -d option at the same time.\n");
                    exit(1);
                }
                f2_flag       = 1;
            }
            _Score_func = 3;
            break;
        case 'r':
            _Rotation_angle_set = atoi(optarg);
            if(_Rotation_angle_set == 54000) {
                cout << "# Set 54,000 rotational angles (6 degree)"<< endl;
            } else if(_Rotation_angle_set == 1) {
                cout << "# Set 1 rotational angle (test mode)"<< endl;
            } else if(_Rotation_angle_set == 3) {
                cout << "# Set 3 rotational angle (test mode)"<< endl;
            } else if(_Rotation_angle_set == 24) {
                cout << "# Set 24 rotational angles (test mode)"<< endl;
            } else if(_Rotation_angle_set == 360) {
                cout << "# Set 360 rotational angles (test mode)"<< endl;
            }
            break;
        case 'D':
            _Rotation_angle_set = 54000;
            cout << "# Set 54,000 rotational angles (6 degree)"<< endl;
            break;

            //-----------------------------------------------------------------
            // help -----------------------------------------------------------
        case 'j':
            tem_flag1 = 1;
            break;
        case 'k':
            tem_flag2 = 1;
            break;
        case 'S':
            lig_elec_serial_flag = atoi(optarg);
            break;
        case 'l':
            fft_base_set = atoi(optarg);
            break;

        case 'h':
            usage ();
            break;
        default:
            usage ();
        }
    }

    pdb_step();
    parameter_set();

    return;
}

//============================================================================//
void Parameter::usage()
//============================================================================//
{
    std::cerr << "\n Usage: megadock -R [receptor.pdb] -L [ligand.pdb] [more options]\n";
    std::cerr << "\n Available options:\n";
    std::cerr << "  -o filename    : set the output filename (default to \"$R-$L.out\")\n";
    std::cerr << "  -O             : output docking detail files\n";
    std::cerr << "  -N integer     : set the number of output predictions (default to 2000)\n";
    std::cerr << "  -t integer     : set the number of predictions per each rotation (default to 1)\n";
    std::cerr << "  -F integer     : set the number of FFT point (default to none)\n";
    std::cerr << "  -v float       : set the voxel size (default to 1.2)\n";
    std::cerr << "  -D             : set the 6 deg. (54000 angles) of rotational sampling\n";
    std::cerr << "                   (default to none, 15 deg. (3600 angles) of rotational sampling)\n";
    std::cerr << "  -r integer     : set the number of rotational sampling angles \n";
    std::cerr << "                   (54000: 54000 angles, 1: 1 angles, 24: 24 angles, default to 3600 angles)\n";
    std::cerr << "  -e float       : set the electrostatics term ratio (default to 1.0)\n";
    std::cerr << "  -d float       : set the hydrophobic term ratio (default to 1.0)\n";
    std::cerr << "  -a float       : set the rPSC receptor core penalty (default to -45.0)\n";
    std::cerr << "  -b float       : set the rPSC ligand core penalty (default to 1.0)\n";
    std::cerr << "  -f 1/2/3       : set function \n";
    std::cerr << "                   (1: rPSC, 2: rPSC+Elec, 3: rPSC+Elec+RDE, default to 3)\n";
    std::cerr << "  -h             : show this message\n" << std::endl;

    exit (-1);
}

//============================================================================//
void Parameter::default_param()
//============================================================================//
{
    // Set default parameters and flag initialization
    _Score_func   = 3;        // rPSC + CHARMM + RecACE (2: rPSC+CHARMM, 1: rPSC)
    grid_width    = 1.2;
    _Num_grid     = 0;
    _Num_fft      = 0;
    _Num_fft_flag = 0;
    _Num_sort     = 1;
    _Elec_ratio   = 1.0;
    _ACE_ratio    = 1.0;
    _Num_output   = 2000;
    _Num_output_flag = 0;
    _Num_atom_max = 0;
    _Num_thread_limit = 9999999;
    _Num_GPU_limit = 9999999;

    _rPSC_param_rec_core  = -45.0;
    _rPSC_param_lig_core  = 1.0;

    detail_output_flag = 0; // output detailed result
    calc_time_log_output_flag = 0;
    calc_id = "undefined";

    _Rotation_angle_set  = 3600; //3600 rotational angles

    lig_elec_serial_flag = 0;
    fft_base_set = 11;

    tem_flag1 = 0;
    tem_flag2 = 0;
    tem_flag3 = 0;
    tem_flag4 = 0;
    f1_flag   = 0;
    f2_flag   = 0;
    
    ligand_max_edge = 0.0;
    fft_library_type = 1;

    _Old_voxel_flag = 0;
    return;
}

//============================================================================//
void Parameter::pdb_step()
//============================================================================//
{
    if( !_IO_flag[0] ) {
        cerr << "[ERROR] Receptor PDB file is not assignment!!" << endl;
        usage();
        exit(1);
    }

    if( !_IO_flag[1] ) {
        cerr << "[ERROR] Ligand PDB file is not assignment!!" << endl;
        usage();
        exit(1);
    }

    if( !_IO_flag[2] ) {
        string  rfile = _RecPDB_file;
        string  lfile = _LigPDB_file;
        string  ofile;
        int     ipr;
        int     ipl;

        while(1) {
            ipr   = rfile.rfind("/");

            if( ipr == (int) string::npos ) {
                break;
            } else {
                rfile = rfile.substr(ipr+1);
            }
        }

        ipr   = rfile.rfind(".");
        rfile = rfile.substr(0,ipr);
        rfile = rfile + "-";

        while(1) {
            ipl   = lfile.rfind("/");

            if( ipl == (int) string::npos ) {
                break;
            } else {
                lfile = lfile.substr(ipl+1);
            }
        }

        ipl   = lfile.rfind(".");
        lfile = lfile.substr(0,ipl);

        ofile = rfile + lfile + ".out";
        _RLOut_file = ofile;
        ofile = rfile + lfile + ".detail";
        _RLOut_file_detail = ofile;
        ofile = rfile + lfile + ".csv";
        _RLOut_file_csv = ofile;
    }

    //cout << "#Receptor = " << _RecPDB_file << endl;
    //cout << "#Ligand   = " << _LigPDB_file << endl;
    cout << "# Output file = " << _RLOut_file << endl;

    return;
}

//============================================================================//
void Parameter::parameter_set()
//============================================================================//
{
    if( _Rotation_angle_set == 3600 ) {
        dangle_rot3600();
    } else if( _Rotation_angle_set == 54000 ) {
        dangle_rot54000();
    } else if( _Rotation_angle_set == 1 ) {
        dangle_rot1();
    } else if( _Rotation_angle_set == 3 ) {
        dangle_rot3();
    } else if( _Rotation_angle_set == 24 ) {
        dangle_rot24();
    } else if( _Rotation_angle_set == 360 ) {
        dangle_rot360();
    } else {
        cerr << "[ERROR] Not support Rotation_angle_mode = " << _Rotation_angle_set << endl;
        exit(1);
    }

    if( _Num_rot_angles*_Num_sort < _Num_output ) {
        cerr << "#[WARNING] Number of output file was changed from " << _Num_output;
        _Num_output = _Num_rot_angles * _Num_sort;
        cerr << " to " << _Num_output << " (" << _Num_rot_angles << " times " << _Num_sort << ")\n";
    }

    _Grid_space_rec = 8.0;
    _Grid_space_lig = 3.0;

    if( _Score_func == 1 ) {
        charmm_radius();
    } else if( _Score_func == 2 ) {
        charmm_radius();
        charmm_charge();
    } else if( _Score_func == 3 ) {
        charmm_radius();
        charmm_charge();
        ace_value();
    }

    else {
        cerr << "[ERROR] Score function is mismatch!!" << endl;
        exit(1);
    }

    return;
}

//============================================================================//
float Parameter::atom_radius(const string &atype)
//============================================================================//
{
    map<string,float>::iterator itr;
    float defaultr = 1.8;     // Carbon radius

    itr = _Charmmr.find(atype);

    if( itr != _Charmmr.end() ) {
        return itr->second;
    } else {
        return defaultr;
    }
}

//============================================================================//
float Parameter::atom_charge(const string &atype)
//============================================================================//
{
    map<string,float>::iterator itr;
    const float defaultr = 0.0;       // neutral

    itr = _Charmmc.find(atype);

    if( itr != _Charmmc.end() ) {
        return itr->second;
    } else {
        return defaultr;
    }
}

//============================================================================//
float Parameter::atom_ace(const string &atype)
//============================================================================//
{
    map<string,float>::iterator itr;
    const float defaultr = 0.0;           // No Atomic Contact Energy

    itr = _ACE.find(atype);

    if( itr != _ACE.end() ) {
        return itr->second;
    } else {
        return defaultr;
    }
}

